  "text" : "\uC9D1\uC9D1\uB9C8\uB2E4 \uC81C\uC138\uB3D9\uAE30\uC640 \uC18C\uD654\uAE30 \uC815\uB3C4\uB294 \uAE30\uBCF8\uC801\uC73C\uB85C \uBE44\uCE58\uB420 \uC218 \uC788\uB3C4\uB85D \uC815\uBD80 \uCC28\uC6D0\uC5D0\uC11C \uC9C0\uC6D0\uD574 \uC92C\uC73C\uBA74 \uD569\uB2C8\uB2E4. \uB2F9\uC7A5 \uC800\uD76C \uC9D1\uB3C4 \uC18C\uD654\uAE30\uAC00 \uC5C6\uC2B5\uB2C8\uB2E4. \uC0AC\uB294\uAC8C \uBB38\uC81C\uAC00 \uC544\uB2C8\uB77C \uC815\uAE30 \uAC80\uC0AC\uC640 \uCDA9\uC804 \uBB38\uC81C\uB85C \uCC38 \uC0AC\uAE30 \uC560\uB9E4\uBAA8\uD638\uD558\uB2E4\uB294.. #fb",
