  "text" : "\uC9D1\uC548\uACFC \uCC28\uC548\uC5D0 \uAF2D \uC788\uC73C\uBA74 \uC88B\uC740 \uBB3C\uAC74 \uC911 \uD558\uB098\uAC00 \uBC29\uB3C5\uBA74.. \uADF8\uB7F0\uB370.. \uACFC\uC5F0 \uC774\uAC8C \uC788\uB2E4\uACE0 \uD574\uB3C4 \uC720\uC0AC\uC2DC\uC5D0 \uC0B4\uC544\uB0A8\uC744 \uD655\uB960\uC774 \uC5BC\uB9C8\uB098 \uB420\uC9C0.. \uC8FC\uBCC0\uC5D0\uC11C \uAC00\uC2A4\uB77C\uB294 \uC804\uD30C \uC5C6\uC774 \uAC00\uC2A4 \uC0C1\uD669\uC774\uB2E4\uB77C\uACE0 \uC778\uC2DD\uD558\uACE0 \uBC29\uB3C5\uBA74 \uC4F0\uB824\uACE0 \uD558\uBA74 \uC774\uBBF8 \uC8FC\uB2D8\uACFC 1:1 \uBA74\uC811\uC0C1\uD669\uC77C\uD150\uB370. #fb",
