  "text" : "\uC791\uB144\uBD80\uD130\uC600\uB098\uC694? \uC9C0\uD558\uCCA0\uC5D0 \uC5EC\uAE30 \uC800\uAE30 \uB193\uC5EC\uC788\uB294 \uBC29\uB3C5\uBA74\uACFC \uAC01\uC885 \uC548\uC804\uC7A5\uBE44 \uBCFC\uB54C\uB9C8\uB2E4 \uCC38 \uC804\uC2DC\uD589\uC815\uC774\uB2E4\uB77C\uB294 \uC0DD\uAC01\uC774 \uAC15\uD558\uAC8C \uB4ED\uB2C8\uB2E4. \uADF8\uB807\uAC8C \uAF2D\uAF2D \uC2DC\uAC74\uC7A5\uCE58 \uD574\uB193\uC73C\uBA74 \uC720\uC0AC\uC2DC\uC5D0 \uC5B4\uCE74\uB77C\uB294\uAC74\uC9C0.. \uB3C4\uB451\uC9C8\uD574\uAC08\uAE4C\uBD10 \uADF8\uB7F0\uAC00\uBCF8\uB370.. \uAD6D\uBBFC\uC218\uC900\uC774 \uADF8\uB530\uAD6C\uC778\uAC70\uB2C8.. \uC5B4\uCA54\uAEF4? #fb",
